//components
import { Advisors } from '../components/Advisors';
import { Pagination } from '../components/Pagination';

export const SearchResults =
    ({ loading, searchQuery, currentAdvisors, advisorsArray, currentPage, advisorsPerPage, fitleredAdvisors, paginate }) => {
        return (
            <>
                <Advisors
                    loading={loading}
                    searchQuery={searchQuery}
                    //currentAdvisors comes from the pagination
                    currentAdvisors={currentAdvisors}
                    advisorsArray={advisorsArray}
                    currentPage={currentPage}
                    advisorsPerPage={advisorsPerPage} />
                <Pagination
                    currentPage={currentPage}
                    advisorsPerPage={advisorsPerPage}
                    totalAdvisors={fitleredAdvisors}
                    paginate={paginate} />
            </>
        )
    }
